import React, { Fragment } from "react";
import "../Styles/seed.css";
import {Link} from "react-router-dom";
import NavBarBtn from "./navBarBtn";
import NavBarLogo from "./navBarLogo";

export default function mobileMenu(props) {
  const { className, } = props;

  return (
    <Fragment>
      <div
        className={` ${className}  d-n m-d-b `} Style="position: fixed; left:0px; right:0px; top: 0px; bottom: 0px; background:rgba(0,0,0,0.5); z-index: 99998;"
      >    
             <div className="w-100 h-a b-0px  h-pr-fl-ma">
          
            <Link to="/team"><div className="w-100 h-a h-pr-fl-ma p-20px" Style="border-bottom: 1px solid; border-color: white;"><NavBarBtn text={"Nosotros"}></NavBarBtn></div></Link>
            <Link to="/team"><div className="w-100 h-a h-pr-fl-ma p-20px" Style="border-bottom: 1px solid; border-color: white;"><NavBarBtn className="" text={"Estructura"}></NavBarBtn></div></Link>
           <Link to="/services"> <div className="w-100 h-a h-pr-fl-ma p-20px" Style="border-bottom: 1px solid; border-color: white;"><NavBarBtn text={"Servicios"}></NavBarBtn></div></Link>
           <Link to="/plans"> <div className="w-100 h-a h-pr-fl-ma p-20px" Style="border-bottom: 1px solid; border-color: white;"><NavBarBtn text={"Planes"}></NavBarBtn></div></Link>
            <div className="w-100 h-a h-pr-fl-ma p-20px" Style="border-bottom: 1px solid; border-color: white;"><NavBarBtn className="" text={"Metodología"}></NavBarBtn></div>
            <div className="w-100 h-a h-pr-fl-ma p-20px" Style="border-bottom: 1px solid; border-color: white;"><NavBarBtn className="" text={"Parámetros"}></NavBarBtn></div>

    
          </div>
        </div>  
    
    </Fragment>
  );
}
